        /**
         * This method iterates through the given matrix and collects all zeroes. Their positions (row x column) are
         * stored in the Map<Integer, LinkedList<Integer>> map. The key for this map will be the number of the row
         * that contains at least one zero, and the LinkedList<Integer> will store the column(s) for each zero that was found.
         * After that, for each '1' element found, the algorithm iterates through the map and calculates the distance from
         * '1' to each '0' stored.
         * The new matrix will store the minimum distance from '1' to a '0'.
         */
    public static int[][] updateMatrix(int[][] mat) {
        int[][] update = new int[mat.length][mat[0].length];
        Map<Integer, LinkedList<Integer>> map = new HashMap<>();

        for (int i = 0; i < update.length; i++) {
            for (int j = 0; j < update[0].length; j++) {
                if (mat[i][j] == 0){
                    map.putIfAbsent(i, new LinkedList<Integer>());
                    map.get(i).add(j);
                }
            }
        }
        int distance;
        for (int i = 0; i < update.length; i++) {
            for (int j = 0; j < update[0].length; j++) {
                if (mat[i][j] == 0){
                    update[i][j] = 0;
                } else {
                    for (Map.Entry<Integer, LinkedList<Integer>> entry : map.entrySet()){
                        for (int k = 0; k < entry.getValue().size(); k++) {
                            distance = Math.abs(entry.getKey() - i) + Math.abs(entry.getValue().get(k) - j);
                            if (update[i][j] > distance){
                                update[i][j] = distance;
                            } else if (update[i][j] == 0){
                                update[i][j] =distance;
                            }
                        }
                    }
                }
            }
        }
        return update;
    }
